export const CREATE_COLLECTION = `
import NSFT from 0xNSFT

transaction {
  prepare(acct: AuthAccount) {
    let collection <- NSFT.createEmptyCollection()
    acct.save<@Collection>(collection, to: NSFT.CollectionStoragePath)
    acct.link<&{NSFT.NSFTCollectionPublic}>(NSFT.CollectionPublicPath, target: NSFT.CollectionStoragePath)
  }
}
`
